import React, {useState, useEffect} from 'react'

var search;
export const Input = () => {
    const [pikachu, setPikachu] = useState();
    const [loaded, setLoaded] = useState(false);
    const [search, setSearch] = useState();
    useEffect(() => {
        Data();
    },[]);

    const Data = async () => {
        const data = await fetch("https://pokeapi.co/api/v2/pokemon/pikachu")
        const gible = await data.json();
        console.log(data);
    }


  return (
    <div>
        <input id='Input' placeholder='Nombre del pokemon' type='text'></input>
        {/* <input value={"Buscar"} aria-label='Buscar' name='btnk' role={"button"} type='submit'></input> */}

        <button id='Btn' onClick={() => {
            console.log(pikachu);
            document.getElementById("Name").textContent = "Nombre: ";
            document.getElementById("Pokemon Name").textContent = pikachu.name;

            document.getElementById("Experience").textContent = "Experiencia Base: ";
            document.getElementById("Pokemon Experience").textContent = pikachu.base_experience;

            document.getElementById("Hp").textContent = "Hp: ";
            document.getElementById("Pokemon Hp").textContent = pikachu.stats[0].base_stat;

            document.getElementById("Atk").textContent = "Atk: ";
            document.getElementById("Pokemon Atk").textContent = pikachu.stats[1].base_stat;

            document.getElementById("Def").textContent = "Def: ";
            document.getElementById("Pokemon Def").textContent = pikachu.stats[2].base_stat;

            document.getElementById("S.Atk").textContent = "S.Atk: ";
            document.getElementById("Pokemon S.Atk").textContent = pikachu.stats[3].base_stat;

            document.getElementById("S.Def").textContent = "S.Def: ";
            document.getElementById("Pokemon S.Def").textContent = pikachu.stats[4].base_stat;

            document.getElementById("Speed").textContent = "Speed: ";
            document.getElementById("Pokemon Speed").textContent = pikachu.stats[5].base_stat;

            document.getElementById("Sprite").textContent = "Sprite: ";
            document.getElementById("PokemonSprite").src = pikachu.sprites.front_default;

            setSearch("pikachu");

            console.log(search);
            // document.getElementById("Input").value


        }}>Buscar</button>

        <br></br>

        <h3 id='Name'></h3>
        <h3 id='Pokemon Name'></h3>

        <h3 id='Experience'></h3>
        <h3 id='Pokemon Experience'></h3>

        <h3 id='Hp'></h3>
        <h3 id='Pokemon Hp'></h3>

        <h3 id='Atk'></h3>
        <h3 id='Pokemon Atk'></h3>

        <h3 id='Def'></h3>
        <h3 id='Pokemon Def'></h3>

        <h3 id='S.Atk'></h3>
        <h3 id='Pokemon S.Atk'></h3>

        <h3 id='S.Def'></h3>
        <h3 id='Pokemon S.Def'></h3>

        <h3 id='Speed'></h3>
        <h3 id='Pokemon Speed'></h3>

        <h3 id='Sprite'></h3>
        <img id='PokemonSprite'></img>

        </div>
  )
}

export const Load = () => {
    const [gible, setGible] = useState();
    const [loaded, setLoaded] = useState(false);
    useEffect(() => {
        fetch("https://pokeapi.co/api/v2/pokemon/" + {search})
        .then(res => res.json())
        .then((pokemon) => setGible(pokemon))
        .catch(err => console.log(err))
        .finally(() => {setLoaded(true)});
    },[]);

return(

    <div>

    <button onClick={() => {
        console.log(gible.base_experience);
    

        document.getElementById("Name").textContent = "Nombre: ";
        document.getElementById("Pokemon Name").textContent = gible.name;
    
        document.getElementById("Experience").textContent = "Experiencia Base: ";
        document.getElementById("Pokemon Experience").textContent = gible.base_experience;
    
        document.getElementById("Hp").textContent = "Hp: ";
        document.getElementById("Pokemon Hp").textContent = gible.stats[0].base_stat;
    
        document.getElementById("Atk").textContent = "Atk: ";
        document.getElementById("Pokemon Atk").textContent = gible.stats[1].base_stat;
    
        document.getElementById("Def").textContent = "Def: ";
        document.getElementById("Pokemon Def").textContent = gible.stats[2].base_stat;
    
        document.getElementById("S.Atk").textContent = "S.Atk: ";
        document.getElementById("Pokemon S.Atk").textContent = gible.stats[3].base_stat;
    
        document.getElementById("S.Def").textContent = "S.Def: ";
        document.getElementById("Pokemon S.Def").textContent = gible.stats[4].base_stat;
    
        document.getElementById("Speed").textContent = "Speed: ";
        document.getElementById("Pokemon Speed").textContent = gible.stats[5].base_stat;
    
        document.getElementById("Sprite").textContent = "Sprite: ";
        document.getElementById("PokemonSprite").src = gible.sprites.front_default;
    }}>Cargar</button>

        <h3 id='Name'></h3>
        <h3 id='Pokemon Name'></h3>

        <h3 id='Experience'></h3>
        <h3 id='Pokemon Experience'></h3>

        <h3 id='Hp'></h3>
        <h3 id='Pokemon Hp'></h3>

        <h3 id='Atk'></h3>
